import axios from 'axios'
import { Todo } from '../types'
const baseUrl = 'http://localhost:3001/api/todos'

const getAll = (): Todo[] => {
  fetch(baseUrl)
  .then(response => response.json)
  .then((res) => {
    return res
  })
}


export {getAll}
